					Need to have:

— Strong Python development skills;
— Knowledge of Django framework;
— Database experience including MySQL and/or PostgreSQL (queries, design);
— Strong understanding of software programming best practices, data structures, algorithms, databases, and networks;...

					— 2+ years of professional experience as an Python developer;
— Solid experience with Django;
— Working knowledge of SQL;
— Experience with HTML, CSS and jQuery;
— Experience with Nginx, Linux;
— Experience in working with platform-to-platform integration (API, xAPI, LTI);...

					Requirements:
— At least 2+ years experience in Manual Software Testing;
— At least 2+ year experience in AQA (Experience in load testing is a plus);
— Strong/Middle knowledge of Java /Python;
— Strong knowledge of software QA methodologies, tools and processes;
— Unit tests;...
